import React from "react";

// import icons
import { BiUser, BiLink, BiMoney, BiDownload, BiStar } from "react-icons/bi";

//import data
import Data from "../data";

//import image
//import Image from "../assets/img/image-box-10.jpg";
function Card2() {
  return (
    <>
    {Data.map((item) =>{
      return(
        <div className="bg-slate-700 shadow-1 p-5 rounded-xl w-full max-w-[352px] mx-auto cursor-pointer hover:shadow-2xl transition">
      <img className="mb-8 rounded-xl ml-3" src={item.image} alt="img" />
      <div className="text-lg font-semibold max-w-[260px] mb-2">" {item.name} "</div>
      <div className="mb-2 flex gap-x-2 text-sm">
        <p>
          {item.description}
        </p>
      </div>
      <div className="text-lg text-violet-400 font-semibold max-w-[260px] mb-2">Stacks</div>
      <div className="flex gap-x-4 my-4">
        <div className="flex items-center texte-gray-600 gap-1 ">
          <div className="text-[20px]">
            <BiUser className="w-xl" />
          </div>
          <div className="">{item.author}</div>
        </div>
        <div className="flex items-center texte-gray-600 gap-1 ">
          <div className="text-[20px]">
            <BiLink className="text-violet-400" />
          </div>
          <div className="">{item.type}</div>
        </div>
        <div className="flex items-center texte-gray-600 gap-1 ">
          <div className="text-[20px]">
            <BiMoney className="text-green-400" />
          </div>
          <div className="text-yellow-300">$ {item.price}</div>
        </div>
      </div>
      <div className="text-xl flex items-center justify-center gap-4 font-semibold text-slate-200  mb-4">
        <button className="text-xl font-bold border border-slate-100 rounded-md p-2 hover:text-violet-600">
          <BiDownload />
        </button>
        <button className="text-xl font-bold border border-slate-100 rounded-md p-2 hover:text-violet-600">
          <BiStar />
        </button>
      </div>
    </div>
      );
    })}

    </>
    );
}

export default Card2;
